import React from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';

import AddAirplaneForm         from './components/AddAirplaneForm';
import ViewAirplanes           from './components/ViewAirplanes';

import AddAirportForm          from './components/AddAirportForm';
import ViewAirports            from './components/ViewAirports';

import AddPersonForm           from './components/AddPersonForm';
import ViewPersons             from './components/ViewPersons';


import AddPassengerBoardForm   from './components/AddPassengerBoardForm';

import OfferFlightForm from './components/OfferFlightForm';
import FlightsList from './components/FlightsList';
import ToggleLicenseForm from './components/ToggleLicenseForm';
import PilotLicensesList from './components/PilotLicensesList';
import FlightsInAir from './components/FlightsInAir';
import FlightsOnGround from './components/FlightsOnGround';
import PeopleInAir from './components/PeopleInAir';
import PeopleOnGround from './components/PeopleOnGround';
import RouteSummary from './components/RouteSummary';
import AlternateAirports from './components/AlternateAirports';



export default function App() {
  return (
    <BrowserRouter>
      <nav style={{ padding: '1rem', borderBottom: '1px solid #ddd' }}>
        <Link to="/"                         style={{ marginRight: '1rem' }}>Home</Link>

        {/* Airplanes */}
        <Link to="/add-airplane"   style={{ marginRight: '0.5rem' }}>Add Airplane</Link>
        <Link to="/view-airplanes" style={{ marginRight: '1rem' }}>View Airplanes</Link>

        {/* Airports */}
        <Link to="/add-airport"    style={{ marginRight: '0.5rem' }}>Add Airport</Link>
        <Link to="/view-airports"  style={{ marginRight: '1rem' }}>View Airports</Link>

        {/* People */}
        <Link to="/add-person"     style={{ marginRight: '0.5rem' }}>Add Person</Link>
        <Link to="/view-persons"   style={{ marginRight: '1rem' }}>View People</Link>

        {/* Flight Operations */}
        <Link to="/passengers-board"       style={{ marginRight: '1rem' }}>Board Passengers</Link>

        <Link to="/offer-flight" className="text-blue-600">Offer Flight</Link>
        <Link to="/flights" className="text-blue-600">View Flights</Link>
        <Link to="/toggle-license" className="text-blue-600">Toggle License</Link>
        <Link to="/pilot-licenses" className="text-blue-600">View Licenses</Link>
        <Link to="/flight-landing" className="text-blue-600">Flight Landing</Link>
        <Link to="/flights-in-air" className="text-blue-600">Flights in the Air</Link>
        <Link to="/flights-on-ground" className="text-blue-600">Flights on the Ground</Link>
        <Link to="/people-in-air" className="text-blue-600">People in the Air</Link>
        <Link to="/people-on-ground" className="text-blue-600">People on the Ground</Link>
        <Link to="/route-summary" className="text-blue-600">Route Summary</Link>
        <Link to="/alternate-airports" className="text-blue-600">Alternate Airports</Link>
      </nav>

      <Routes>
        <Route path="/" element={<p style={{ padding: '2rem' }}>Select an action above.</p>} />

        {/* Airplanes */}
        <Route path="/add-airplane"   element={<AddAirplaneForm />} />
        <Route path="/view-airplanes" element={<ViewAirplanes   />} />

        {/* Airports */}
        <Route path="/add-airport"    element={<AddAirportForm  />} />
        <Route path="/view-airports"  element={<ViewAirports    />} />

        {/* People */}
        <Route path="/add-person"     element={<AddPersonForm   />} />
        <Route path="/view-persons"   element={<ViewPersons     />} />

        {/* Flight Operations */}
        <Route path="/passengers-board"       element={<AddPassengerBoardForm   />} />

        <Route path="/offer-flight" element={<OfferFlightForm />} />
          <Route path="/flights" element={<FlightsList />} />
          <Route path="/toggle-license" element={<ToggleLicenseForm />} />
          <Route path="/pilot-licenses" element={<PilotLicensesList />} />
          <Route path="/flight-landing" element={<FlightLandingForm />} />
          <Route path="/flights-in-air" element={<FlightsInAir />} />
          <Route path="/flights-on-ground" element={<FlightsOnGround />} />
          <Route path="/people-in-air" element={<PeopleInAir />} />
          <Route path="/people-on-ground" element={<PeopleOnGround />} />
          <Route path="/route-summary" element={<RouteSummary />} />
          <Route path="/alternate-airports" element={<AlternateAirports />} />
          <Route path="*" element={<div>Select a page above</div>} />

        <Route path="*" element={<p style={{ padding: '2rem' }}>Page not found.</p>} />
      </Routes>
    </BrowserRouter>
  );
}
